description:
INFINITI FX 35 V6 PREМIUМ individuаl peстайлинг чистый японец для Eвропы.

Авто дилерский. Эксплуатация c 12.2006
Покупал мной в октябре 2018 г. с прoбегoм 190 тыc. ПТС дубликат, пятый владелец, по факту четвёртый, я собственник. 
-РЕАЛЬНЫЙ РАСХОД БЕНЗИНА 14Л. НА 100 КМ. ПО ГОРОДУ;
-DVD,СD,МР3,АUХ;
-Стерео система ВОSЕ;
-Возможность смотреть DVD в движении и для передних пассажиров;
-Парктроник перед, зад;
-Ксенон,би-ксенон;
-Двух зонный климат;
-Электро сидения, память водителя;
-Электро мультируль;
-Электро зеркала+ подогрев;
-Панорамный люк;
-Круиз контроль; 
-Перфорированный кожаный салон; 
-Комплект летней резины nokian;
-Оригинальный пробег 100%;
-Документы (история) о проделанных ТО за период моего владения;
-Замена масла каждые 7 тыс.;
-Бережная эксплуатация, не гоняю, не рву с места, спокойная езда; 
-Не прокуренный, ухоженный, чистый салон. Химчистка не требуется. 
-Все работает, без вложений.
Продам в хорошие руки.
В САЛОН НЕ ПОСТАВЛЮ, ПЕРЕКУПАМ НЕ ПРОДАМ.

Уникальный автомобиль. На Армянском учете, но без проблем Армянского учета.
Растаможен в России, без претензий с стороны ГИБДД по 12.1/12.3 и ФТС!

Транспортный налог 12000 руб/год (против стандартных 42000 руб);
Без штрафов с камер/парковок (сам не нарушаю, но все же), даже за 2 месяца в случае остановки инспектором;
номера 777 ** 99;
управлять может любой человек с действующим ВУ;

Я второй владелец, покупал у официального дилера Infiniti АвтоСпецЦентр на Ленинском проспекте в Москве в июне 2013 года с подтвержденным пробегом 35 000 км. Ограничений по рег.действиям нет, юридически чистая, в ПТС занесена запись о продаже дилером. После покупки на учет в РФ не ставил. В Сентябре 2019 года съездил в Армению, зарегистрировал юридическое лицо и поставил автомобиль на учет в Армении на это самое юридическое лицо.

Автомобиль был ввезен в Россию и растаможен производителем на Центральной Акцизной Таможне в конце 2008 года. Без претензий с стороны ГИБДД по 12.1 (так как собственник юридическое лицо) и 12.3 (так как растаможен в РФ) - не путайте с автомобилями, растаможенными по льготным ставкам в Армении, это совсем другой случай! Кроме того, в любой момент вы можете снять данный автомобиль с учета в Армении и поставить обратно на учет в РФ без всяких кнопок ГЛОНАСС и тп. ПТС лежит в архиве ГАИ в г. Москва (на руках есть копия, в том числе нотариально заверенная). ОСАГО 12000 руб в год без ограничений.

Двигатель, коробка и остальное - работают как часы. Подвеска идеал. Сам не курю и другим курить в салоне не разрешаю. Имеется вся история обслуживания за весь период с момента покупки первым собственником в 2009 году по текущее время (заказ-наряды, чеки, выписки по купленным запчастям и тп). По кузову есть притертости, царапины, пару вмятин, но без серьезного криминала. Масло и фильтры меняю каждые 7500км, лью оригинальный Мотюль, от замены до замены щуп на середине (не ест масло). Два комплекта живой (два сезона, езжу мало) летней и зимней резины - Toyo Proxes T1R 245/45 и KUMHO I'Zen KW27 245/50 липучка. Обслуживался в клубном сервисе I-Gear и у официального дилера, несколько тысяч км назад поменял все четыре ступицы в круг и заменил крестовину кардана (стандартные для этой модели болячка к 120 тысячам пробега). Ближайшие пятьдесят тысяч можно спокойно ездить, меняя только расходники. Из доработок стоит стальная защита двигателя и коробки, противоугонки, светодиодиодные ПТФ (отлично светят и выглядят, родные отдам в подарок), а так же заменены форсунки омывателя лобового на веерные от M37 (стоковые форсунки ужасны).

Очень люблю эту машину, но вынужден неспешно продавать в связи с расширением семейства - покупаю внедорожник. Динамики хватает "за глаза", полный привод зимой просто сказка. Настоящий Японец с настоящим "доипотечнокризисным" японским качеством, сейчас так уже не делают. Соотношение цена/качество зашкаливает. 

Единственный оставшийся недостаток данной модели - достаточно прожорливая (12л по трассе и 16-18л по городу). Решается установкой ГБО - двигатель VQ35DE отлично переводится на газ, без снижения ресурса и динамики (на Drive2 есть много историй). Супер комфортная и надежная машина, а с ГБО еще и супер экономичная. Продается путем продажи юр лица - юр лицо нулевое, деятельности не ведет. Бух услуги за нулевую отчетность 100$ в год, оформляется дистанционно. Возить переоформлять автомобиль никуда не надо - сел и поехал, достаточно оформить продажу ООО у нотариуса. Отвечу на все вопросы по телефону.

Продаётся надежный автомобиль Инфинити g25. По факту я третий владелец  (физ.лицо), первый владелец юр.лицо, второй и третий родственник ( который трижды менял номера ). Машина с реальным пробегом до 65000 обслуживалась у официального дилера (Инфинити Таганка), все заказ наряды в наличии, после чего так же было должное обслуживание, есть все заказ-наряды. Я приобрёл машину с пробегом 105 000. На пробеге 115 000 было установлено ГБО евро-4 (digitronic AEB) баллон на 50 литров. ( все документы в наличии). Расход на газу - 14 литров город, 10 литров трасса - очень экономично.  На 120 000 было пройдено большое ТО, замена масла АКПП, замена тормозных суппортов и дисков от старших собратьев (fx 37), перебрана вся подвеска, масло лью AMSOIL-5w30. Помимо прочего было выполнено предыдущим хозяином:
- лампы HPL - динамические поворотники и ДХО с плавным притуханием и в передних, и в задних фарах;
- доп. радиатор АКПП;
- охранная система с меткой, пин-кодом и обратной связью Призрак;
- проставки на колеса для правильного вылета если что, снимаются за 5 мин;
- устранена раз и навсегда течь масла в свечных колодцах - болячка этих моторов
- заменена клапанная крышка и сразу промазано герметиком;
- замена клапана РVС;
- разблокировано DVD в движении, можно в пробках смотреть фильмы;
- атермальная пленка на передние боковые и лобовое (оригинал);
- ручки управления магнитолой и климатом из алюминия;
- руль перешит в нормальную кожу;
- установлены усиленные стабы поперчной устойчивости, и перед, и зад от G37 купе (гораздо лучше рулится);
- пружины также от G37 полноприводной - подвеска более упругая и адекватная;
- прошита коробка у Димы Ёжика, кто знает, тот поймет. Работает спорт режим и можно переключаться по 4 картам настроек коробки;
- чипа на движок нет; как итог — коробка меньше дергается, нет пинков от переключения поворотника, как у многих фиников;
- масло заливается исключительно AMSOIL Signature 5W30, и раз в 6-8 тыс;
- панели салона обтянуты пленкой под шлифованный алюминий; 
- ручка КПП обтянута нормальной кожей;
- кожа сидений постоянно обрабатывалась спец. химией, нет залома валика сиденья водителя.

1 владелец!!!
На гарантии до 22 года.
Авто был привезён из Сибири, а значит местной сырости не видел))))
Автомобиль в отличном состоянии по всем параметрам. Авто мой, покупался мной за наличные в ноябре ‘18 года.
В меру шустрый и экономичный. Расход 14,5 литров.
Светодиодная оптика полностью;
Электро сиденья с подогревом;
Зеркала электро со складыванием;
Камера;
Парктроники;
Кожаный салон (включая торпедо и переднюю панель);
Сигнализация с GSM, GPS;
Зимняя резина Хакка 9 на шипах + летние
Езжу мало, автомобиль люблю и ухаживаю. ТО строго у дилера (по времени, а не по пробегу).
Остальное при осмотре.
Небольшой торг.

Комплектация Sport+NAVI, с 15 по 19 год числилась на дилере Infiniti, по факту находилась в одних руках. По ПТС 3 владельца первые два дилер (сохраняли номер) третий физ. лицо. 
Что сделано:
Салонный пластик (аквапринт черное дерево и шлифованный алюминий под матовым лаком);
Сняты рейленги, установлены заглушки;
22 диски реплика Hamann (родные «пропеллеры» фактически новые, пойдут вторым комплектом см. фото);
Установлены ДХО совмещены с поворотниками горят при включении зажигания;
Корпуса зеркал выкрашены в черный глянец;
